import moment from "moment";

const initialState = {
    events: [{
            title:'Cumpleaños del Gama',
            start: moment().toDate(),
            end: moment().add(2, 'hours').toDate(),
            bgcolor: '#fafafa',
            notes: 'Comp',
            user:{
                uid: '12345',
                name: 'Branco'
            }
    }],
    activeEvent: null
};

export const calendarReducer = (state = initialState, action) =>{
    switch (action.type) {
    
        default:
            return state;
    }
}
